  return (
    <footer>
      <img src={footerImage} />
      <div className="footer-container">
        <p>sign up for our newsletter and get 10% off your next order</p>
        <input className="emailInput" placeholder="  YOUR EMAIL" />
      </div>
      <FooterNav />
    </footer>
  );
};

export default Footer;
